import React from 'react';
import { Card, CardContent, Typography, Grid, CardHeader} from '@material-ui/core';
import styles from './Cards.module.css';
import CountUp from 'react-countup'

const  Cards = ({data :{confirmed, recovered, deaths, lastUpdate }}) => {
  // console.log(props);
  if (!confirmed){
    return 'Loading...'
  }
  else {

  
  return( <div className={styles.container} >
    <Grid container spacing={5}>
      <Grid item component={Card} spacing={5} >
        <CardContent>
        <Typography color='textSecondary' gutterBottom>INFECTED</Typography>
          <Typography variant='h5'>
            <CountUp 
            start={0}
            end={confirmed.value}/> </Typography>
          <Typography color = 'textSecondary'>{lastUpdate}</Typography>
          <Typography variant='body2'>Number of Active Cases</Typography>
          </CardContent>  
      </Grid>
      <Grid item component={Card} spacing={3} >
        <CardContent>
        <Typography color='textSecondary' gutterBottom>ACTIVE</Typography>
          <Typography variant='h5'>
            <CountUp 
            start={0}
            end={recovered.value}/> </Typography>
          <Typography color = 'textSecondary'>Real date</Typography>
          <Typography variant='body2'>Number of Active Cases</Typography>
          </CardContent>  
      </Grid>
      <Grid item component={Card} spacing={3} >
          <CardContent>
          <Typography color='textSecondary' gutterBottom>DEATHS</Typography>
          <Typography variant='h5'>
            <CountUp 
            start={0}
            end={deaths.value}/> </Typography>
          <Typography color = 'textSecondary'>Real date</Typography>
          <Typography variant='body2'>Number of Active Cases</Typography>
          </CardContent>  
      </Grid>

    </Grid>
    
  </div>

  ) }
}
export default Cards
